          "description": "SUBSCRIBE to NEVER Miss a Theory! â–º https://goo.gl/kQWHkJ    \n\nI'm back with 3 more FNAF theories! From the FNAF Security Breach DLC poster to the Fazbear Frights books, I will NEVER be done with Five Nights At Freddy's. Never. Ever. Let's see what mysteries we can solve today! \n\nGet Your TheoryWear! â–º  https://theorywear.com/\nSUBSCRIBE to Catch all the Theories! â–º https://goo.gl/kQWHkJ    \n\nNeed Royalty Free Music for your Content? Try Epidemic Sound.\nGet A 30 Day Free Trial! â–º http://share.epidemicsound.com/MatPat\n   \nMore THEORIES: \nFNAF, The FINAL Timeline â–ºâ–º https://bit.ly/2MlHYFe\nFNAF, The Monster We MISSED! â–ºâ–º https://youtu.be/_ygN8HLCaJg\nFNAF This Theory Changes Everything â–º https://bit.ly/2JUQUn6\nFNAF, You Were Meant To Lose â–º https://youtu.be/7bn8hM9k0b0\nFNAF 6, No More Secrets â–º https://bit.ly/2LVCq4u   \n\nCredits:\nWriters: Matthew Patrick and Tom Robinson \nEditors: Tyler Mascola, Pedro Freitas, and Jerika (NekoOnigiri)\nSound Editor: Yosi Berman \n\n#FNAF #FiveNightsAtFreddys #FNAFSecurityBreach #FNAFSecurityBreachDLC #FNAFTheory #FNAFLore #SecurityBreach #FNAFDLC  #MatPat #Theory #GameTheory"
